import React from 'react';
import articleContent from './Article-Content';

const ArticlesList = () => (
    <React.Fragment>
        <h1>Articles</h1>
        {articleContent.map(article => (
            <h3>{article.title}</h3>
        ))}

    </React.Fragment>
);

export default ArticlesList;
